import React, {useState, useEffect} from "react";

function Ranking() {

    const [dbData, setDbData] = useState([]);
    let count = 1;

    useEffect(() => {
        fetch('/dbTest')
        .then((res) => res.json())
        .then((data) => setDbData(data.dbData));
    },[])

    return (
        <div>
            <label>JapanSystem</label>
            <br/>
            <label>月間イイね！ランキング</label>
            <br/>
            <br/>
            {/*JSON形式で受け取ったオブジェクトを表示*/}
            <table>
                <thead>
                    <th>a</th>
                    <th>b</th>
                    <th>c</th>
                </thead>
                <tbody>
                    <td>a</td>
                    <td>b</td>
                    <td>c</td>
                </tbody>
            </table>
	        <ul>
                <li>a b csssss</li>
                {dbData.map((data) => (
	            <li key={data.postUser} style={{listStyleType:"none"}}>
		            {count++} {data.postUser} {data.likeCount}
	            </li>
            ))}</ul>
        </div>
    );
}

export default Ranking;
